import axios from "axios";

export default axios.create({
    baseURL: "http://localhost:5000/api/file",
    withCredentials: true,
    headers: {
        "Access-Control-Allow-Origin": "*",
        "Access-Control-Allow-Credentials": "true"
    }
});
